<script>
    $(window).ready(function() {
        var flag = 0;
        $('#submit-button').click(function() {            
            if ( $('#form-input').val() == '') {
                return 0;
            } else {
                $('#feedback').modal('show');
                if (flag === 0) {
                    $('.modal-body.success').addClass('show');
                    $('.modal-body.failure').removeClass('show');
                    flag = 1;
                } else {
                    $('.modal-body.success').removeClass('show');
                    $('.modal-body.failure').addClass('show');
                    flag = 0;
                }
            }            
        });
        
        $('.modal').click(function() {
            $('#feedback').modal('hide');
        });
        
    });
</script>
